import React from 'react';
import './Login.scss';

export default function Login() {
  return (
    <div className='login__container'>
      <span className='login__header'>
        sign in to your account
      </span>

      <form>
        <input type="text" name='userName'/>
        <input type="password" name='password' />
      </form>
    </div>
  )
}
